//use tailwind styles
import player from "./player";
function FormWrapper() {
    return <Form object={player.config}/>
}

function Form(props) {
    return (
        <div>
            {Object.keys(props.object).map((key) => {
                return (
                    <div className="flex flex-col border p-1" key={key}>
                        <label className="text-xl">{key}</label>
                        {typeof props.object[key] === 'object' && props.object[key] !== null ? (
                            <Form object={props.object[key]}/>
                        ) : (
                            props.object[key] === true || props.object[key] === false ? (
                                <input
                                    className="border-2 border-black rounded-md w-5"
                                    type="checkbox"
                                    checked={props.object[key]}
                                    onChange={(e) => {
                                        props.object[key] = e.target.checked;
                                    }}
                                />
                            ) : (
                            <input
                                className="border-2 border-black rounded-md"
                                type="text"
                                value={props.object[key]}
                                onChange={(e) => {
                                    props.object[key] = e.target.value;
                                }}
                            />
                            ))}
                    </div>
                );
            })}
        </div>
    );
}

export default Form;
